const e={back:"Back"},t={nav:{works:"Works",about:"About"}},o={greatings:"Greetings, i'm an italian developer.",developer:"Developer",works:{title:"Works and projects",content:{1:"I currently work for ",2:", an innovative startup, based in San Giovanni in Marignano(RN, Italy), that deals with management and online booking for bathing establishments. I've also worked for ",3:" as a mobile developer, using a cross-platform framework. I have also created ",4:" an application for calculating the blood alcohol level in real time."},callToAction:"More"},bio:{title:"Bio",content:{1:"Born in Cattolica (RN), Italy.",2:"Moved to San Giovanni in Marignano (RN), Italy.",3:"Graduated at ",4:"Studied comuper sience at ",5:"Worked at ",6:" traveling around the country.",7:"Worked at ",8:" as a mobile developer, building a crossplatform application using React Native.",9:"Currently working at ",10:", testing both management system for bathing establishments and online reservations."},callToAction:"More"}},n=[{header:"Works",list:[{title:"Beacharound",description:"Search portal and online booking of positions in bathing establishments throughout Italy."},{title:"Beacharound Business",description:"Cloud management and online reservations for bathing establishments."},{title:"PicWix for Mango Mobile",description:"Cross platform application in React Native that allows you to manage contests (photos and videos) with prizes."}]},{header:"Projects",list:[{title:"Drink Tool",description:"Real-time blood alcohol content calculator: BAC (Blood Alcohol Content)."}]},{header:"Older projects",list:[{title:"Howmuchcanidrink",description:"Simple calculations on the effects of the quantities of alcohol ingested, knowing your biometric data."}]}],a={aboutMe:"About me",aboutMeContent1:"My name is Riccardo Buzzolo, I was born in Cattolica (RN) on 13 December 1994. I graduated from the Technical Institute for Surveyors O. Belluzzi in Rimini (today ",aboutMeLink1:"State Technical Technological Institute",aboutMeContent2:"). Later I studied at the Alma Mater Studiorum University of Cesena, in the course of ",aboutMeLink2:"Engineering and Computer Science",aboutMeContent3:'. I worked for a while as a mobile programmer for Mango Mobile, in Cesena, and as an evaluator for the Teddy group, in Rimini. I currently work as a "full-stack" web programmer for an innovative startup, in San Giovanni in Marignano, which deals with management and online bookings for bathing establishments throughout the country: ',aboutMyWork:"About my work",aboutMyWorkContent1:"As mentioned above, I work for a startup in San Giovanni in Marignano that deals with management for bathing establishments and online booking of the same: ",aboutMyWorkContent2:' My work changes in some aspects between the summer and winter seasons. During the winter season the work is focused on the development of the management system, and therefore on the tests to be carried out on the new functions or changes made to the management system. Basically, these are end-to-end tests, to verify the functioning of the various flows of operations, and API tests (as part of "integration testing"), to verify the correct use of the data. During the summer season, my work is mainly focused on providing technical assistance to managers who are experiencing problems and collecting/analyzing data to improve the program.'},i={generic:e,layout:t,home:o,works:n,about:a};export{a as about,i as default,e as generic,o as home,t as layout,n as works};
